import React from "react";
import Stock from "./Stock";

const PassText = (props) => {
  const symbol = `${props.someText}`;
  return (
    <div>
      <h1>{props.someText}</h1>
      <Stock sign={symbol} />
    </div>
  );
};

export default PassText;
